import React from 'react';
import { Table} from 'react-bootstrap';



const CustomerList = (props) => {
    if (props.data) {
        const mappedList = props.data.map((item) => {
            return (
                <div key={item.id}>
                    <Table>
                        <thead>
                            <tr>
                                <th></th>
                                <th>{item.id}</th>
                                <th></th>
                                <th></th>
                            </tr>
                        </thead>
                        <p>{item.id}</p>
                        <p>{item.firstName}</p>
                        <p>{item.lastName}</p>
                        <p>{item.country}</p>
                    </Table>
                </div>
            )
        });
        return mappedList;
    } else {
        return (
            <div />
        );
    }
}

export default CustomerList;
